import { Switch } from "@mui/material";
import { useState } from "react";

const ByeSell = () => {
  const [state, setState] = useState([true, true, true, true]);

  const handleChange = (i) => {
    const old = [...state];
    old[i] = !old[i];
    setState(old);

    console.log(old[i] ? `Switch ${i + 1} On` : `Switch ${i + 1} Off`);
  };

  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "gray",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          height: "50%",
          width: "90%",
          background: "white",
          display: "flex",
        }}
      >
        <div
          style={{
            flex: 5,
            display: "flex",
            padding: 10,
          }}
        >
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <h1
              style={{
                fontSize: 22,
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
              }}
            >
              COIN NAME
            </h1>
            <h1
              style={{
                fontSize: 22,
                display: "flex",
                justifyContent: "center",
                alignItems: "left",
              }}
            >
              BUYING AMOUNT
            </h1>
            <h1
              style={{
                fontSize: 22,
                display: "flex",
                justifyContent: "center",
                alignItems: "left",
              }}
            >
              SELLING AMOUNT
            </h1>
            <h1
              style={{
                fontSize: 22,
                display: "flex",
                justifyContent: "center",
                alignItems: "left",
              }}
            >
              GRID AMOUNT
            </h1>
          </div>
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <div
              style={{
                height: "15%",
                width: "60%",
                border: "1px solid black",
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              div_1
            </div>
            <div
              style={{
                height: "15%",
                width: "60%",
                border: "1px solid black",
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              div_2
            </div>
            <div
              style={{
                height: "15%",
                width: "60%",
                border: "1px solid black",
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              div_3
            </div>
            <div
              style={{
                height: "15%",
                width: "60%",
                border: "1px solid black",
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              div_4
            </div>
          </div>
        </div>
        <div style={{ flex: 5, display: "flex", padding: 10 }}>
          {" "}
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <p
              style={{
                fontSize: 22,
                alignItems: "center",
                display: "flex",
                justifyContent: "center",
              }}
            >
              AUTO SELLING
            </p>
            <p
              style={{
                fontSize: 22,
                alignItems: "center",
                display: "flex",
                justifyContent: "center",
              }}
            >
              AUTO BUYING
            </p>
            <p
              style={{
                fontSize: 22,
                alignItems: "center",
                display: "flex",
                justifyContent: "center",
              }}
            >
              SELLING AMOUNT
            </p>
            <p
              style={{
                fontSize: 22,
                alignItems: "center",
                display: "flex",
                justifyContent: "center",
              }}
            >
              GRID AMOUNT
            </p>
          </div>
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            {state.map((isChecked, i) => (
              <div key={i} style={{ height: "15%", width: "60%" }}>
                <Switch onChange={() => handleChange(i)} checked={isChecked} />
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ByeSell;
